    public static func == (lhs: AccountAddress, rhs: AccountAddress) -> Bool {
        if lhs.secretMagic != rhs.secretMagic {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(secretMagic)
    }
}

